import React, { useState } from 'react';

import './css/LogIn.css';
import { IonInput, IonText, IonButton, IonLoading } from '@ionic/react';

const LogIn: React.FC = () => {

    const [showLoading, setShowLoading] = useState(true);

    setTimeout(() => {
        setShowLoading(false);
    }, 2000);

        return (
            <div id="login-form">
                <div id="Logo">
                </div>
                <div id="phrase">
                    <IonText>
                        O teu gin√°sio da UMinho...
                    </IonText>
                </div>
                <div id="input-form">
                    <br></br>
                    <IonInput id="email-input" placeholder="E-Mail"></IonInput>
                    <br></br>
                    <IonInput id="pass-input" placeholder="Password"></IonInput>
                </div>
                <IonButton id="login-button" onClick={() => setShowLoading(true)}>Log-In</IonButton>
                <IonLoading
                    isOpen={showLoading}
                    onDidDismiss={() => setShowLoading(false)}
                    message={'A carregar'}
                    duration={5000}
                />
            </div>
    );
};

export default LogIn;
